import "./App.css";
import axios from "axios";
import { useHistory } from "react-router";
import { useState, useEffect } from "react";

function App() {
  const history = useHistory();

  return (
    <div className="container">
      <br />
      <a href="/home">
        <button type="submit" className="btn btn-primary  ">
          Home
        </button>
      </a>
    </div>
  );
}

export default App;
